import React,{useContext} from "react";
import { Route, Routes } from "react-router-dom";
import Layout from "./Components/Layout/Layout";
import Login from "./Components/Login/Login";
import Home from "./Components/Home/Home";
import Profile from "./Components/Login/Profile/Profile";
import LoginContext from "./Components/Login/Store/login-context";
import NewPassword from "./Components/Login/NewPassword/NewPassword";
import AddExpense from "./Components/AddExpense/AddExpense";
import AboutUs from "./Components/AboutUs/AboutUs";


const App=()=>{

  const ctx=useContext(LoginContext)

  return(
    <Layout>
      <Routes>
        <Route path='/' element ={<Login />} />
        <Route path='/Home' element={<Home />} />
        {ctx.isLoggedin && <Route path="/Profile" element={<Profile />} />}
        {ctx.isLoggedin && <Route path="/AddExpense" element={<AddExpense />} />}
        <Route path="*" element={<Home />} />
        <Route path="/NewPassword" element={<NewPassword />} />
        <Route path="/AboutUs" element={<AboutUs />} />
      </Routes>
    </Layout>
  )
}

export default App
